import React, { Component } from "react";

class IndexIntroText extends Component {
  state = {};
  render() {
    return (
      <div id="textWrapper">
        <div id="header">
          <span id="headerText">Welcome to Receiply</span>
        </div>
        <div id="subtitle">
          Family recipe sharing made easy, for{" "}
          <span
            style={{ fontWeight: "bold", fontStyle: "italic", fontSize: 27 }}
          >
            everyone.
          </span>
        </div>
      </div>
    );
  }
}

export default IndexIntroText;
